sparql_query:
prefix dbo: <http://dbpedia.org/ontology/>
prefix schema: <http://schema.org/>
SELECT ?x {
GRAPH ?g {<%s> dbo:location ?loc.
?loc schema:streetAddress ?address; 
schema:postalCode ?postal; 
schema:addressLocality ?city.
BIND(concat(STR(?address), " ", STR(?postal), " ", STR(?city)) as ?x)
}
}

prefix dct: <http://purl.org/dc/terms/>
prefix foaf: <http://xmlns.com/foaf/0.1/>
SELECT ?x {GRAPH <%s> {?a a foaf:Document; dct:title ?x.}}

PREFIX swpo: <http://sw-portal.deri.org/ontologies/swportal#>
prefix foaf: <http://xmlns.com/foaf/0.1/>
SELECT ?x {GRAPH ?g {
<%s> swpo:hasLeader ?leader.
?leader foaf:name ?x.
}}

prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>
prefix foaf: <http://xmlns.com/foaf/0.1/>
ASK { GRAPH <%s> {?x a foaf:Document; rdfs:label "StudentAssistant".}}

PREFIX ex: <http://example.org/>
prefix foaf: <http://xmlns.com/foaf/0.1/>
SELECT ?x {GRAPH ?g {<%s> a foaf:Person; ex:address ?room. ?room ex:name ?x.}}

prefix foaf: <http://xmlns.com/foaf/0.1/>
prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?x {GRAPH ?g {?group foaf:member <%s>; rdfs:label ?x. }}

PREFIX ex: <http://example.org/>
prefix foaf: <http://xmlns.com/foaf/0.1/>
prefix dbo: <http://dbpedia.org/ontology/>
SELECT ?x {GRAPH ?g {<%s> swpo:hasLeader ?leader.
?leader a foaf:Person; ex:address ?room. ?room ex:name ?x.
}}

prefix bibo: <http://purl.org/ontology/bibo/>
prefix dct: <http://purl.org/dc/terms/>
SELECT ?x {GRAPH ?g {?theses a bibo:Thesis; dct:creator <%s>; dct:title ?x.}}
